import React, { Component } from 'react';
import './App.css';
import Person from './Person/Person';

class App extends Component {

  state = {
    persons : [
        {name: 'JP', age: '27'},
        {name: 'ML', age: '26'},
        {name: 'Billou', age: '21'}
    ]
  };

  render() {
    return (
      <div className="App">

        <Person age={this.state.persons[0].age} name={this.state.persons[0].name}/>
        <Person age="26" name="ML">I live in Germany</Person>
        <Person age="21" name="Billou"/>

      </div>
    );
  }
}

export default App;
